<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Making Presentations That Stick</title>
    <style>
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      body {
        font-family: "Segoe UI", -apple-system, BlinkMacSystemFont, Roboto, sans-serif;
        line-height: 1.5;
      }

      .ppt-app {
        background: #f3f2f1;
        overflow: hidden;
        width: 100%;
        aspect-ratio: 16 / 9;
        display: flex;
        flex-direction: column;
        font-size: clamp(8px, 1.2vw, 14px);
      }

      .ppt-titlebar {
        display: flex;
        align-items: center;
        padding: 0.4em 0.8em;
        background: #c43e1c;
        gap: 0.8em;
      }

      .ppt-titlebar-icon {
        width: 1.4em;
        height: 1.4em;
        background: white;
        border-radius: 2px;
        display: flex;
        align-items: center;
        justify-content: center;
        font-weight: bold;
        font-size: 0.8em;
        color: #c43e1c;
      }

      .ppt-titlebar-text {
        flex: 1;
        color: white;
        font-size: 0.9em;
        font-weight: 400;
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
      }

      .ppt-main {
        display: flex;
        background: #e1dfdd;
        flex: 1;
        min-height: 0;
        overflow: hidden;
      }

      .ppt-slides-panel {
        width: 11em;
        background: #f3f2f1;
        border-right: 1px solid #d2d0ce;
        padding: 0.8em;
        display: flex;
        flex-direction: column;
        gap: 0.5em;
        overflow-y: auto;
        scrollbar-width: thin;
        scrollbar-color: #a19f9d #e1dfdd;
      }

      .ppt-slides-panel::-webkit-scrollbar {
        width: 0.5em;
      }

      .ppt-slides-panel::-webkit-scrollbar-track {
        background: #e1dfdd;
        border-radius: 0.25em;
      }

      .ppt-slides-panel::-webkit-scrollbar-thumb {
        background: #a19f9d;
        border-radius: 0.25em;
      }

      .ppt-slides-panel::-webkit-scrollbar-thumb:hover {
        background: #8a8886;
      }

      .ppt-thumbnail {
        background: white;
        border: 0.15em solid transparent;
        border-radius: 0.2em;
        padding: 0.2em;
        cursor: pointer;
        transition: all 0.15s ease;
        position: relative;
        flex-shrink: 0;
      }

      .ppt-thumbnail.active {
        border-color: #c43e1c;
      }

      .ppt-thumbnail:hover:not(.active) {
        border-color: #a4a4a4;
      }

      .ppt-thumbnail img {
        width: 100%;
        aspect-ratio: 16/9;
        object-fit: cover;
        display: block;
        border-radius: 0.15em;
      }

      .ppt-thumbnail-number {
        display: none;
      }

      .ppt-viewport-area {
        flex: 1;
        padding: 1.5em;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        min-width: 0;
        overflow: hidden;
      }

      .ppt-slide-frame {
        background: white;
        box-shadow: 0 0.15em 0.5em rgba(0, 0, 0, 0.15);
        width: 100%;
        max-width: 100%;
        aspect-ratio: 16/9;
        display: flex;
        align-items: center;
        justify-content: center;
        overflow: hidden;
      }

      .ppt-slide-frame img {
        width: 100%;
        height: 100%;
        object-fit: contain;
        transition: opacity 0.2s ease;
      }

      .ppt-slide-frame img.loading {
        opacity: 0.6;
      }

      .ppt-bottombar {
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 0.4em 1em;
        background: #f3f2f1;
        border-top: 1px solid #d2d0ce;
        font-size: 0.8em;
        color: #605e5c;
      }

      .ppt-nav-controls {
        display: flex;
        align-items: center;
        gap: 0.5em;
      }

      .ppt-nav-btn {
        width: 2em;
        height: 1.7em;
        border: 1px solid #d2d0ce;
        background: white;
        border-radius: 0.2em;
        cursor: pointer;
        display: flex;
        align-items: center;
        justify-content: center;
        color: #323130;
        transition: all 0.1s ease;
      }

      .ppt-nav-btn:hover:not(:disabled) {
        background: #f3f2f1;
        border-color: #8a8886;
      }

      .ppt-nav-btn:disabled {
        opacity: 0.4;
        cursor: default;
      }

      .ppt-nav-btn svg {
        width: 1em;
        height: 1em;
      }

      .ppt-slide-counter {
        font-size: 0.85em;
        color: #323130;
        flex: 1;
        text-align: center;
      }

      @media (max-width: 480px) {
        .ppt-slides-panel {
          display: none;
        }

        .ppt-viewport-area {
          padding: 1em;
        }
      }
    </style>
  </head>
  <body>
    <div class="ppt-app" id="ppt-viewer">
      <div class="ppt-titlebar">
        <div class="ppt-titlebar-icon">P</div>
        <span class="ppt-titlebar-text">Presentation.pptx - PowerPoint</span>
      </div>

      <div class="ppt-main">
        <div class="ppt-slides-panel"></div>

        <div class="ppt-viewport-area">
          <div class="ppt-slide-frame">
            <img src="" alt="Current slide" />
          </div>
        </div>
      </div>

      <div class="ppt-bottombar">
        <button class="ppt-nav-btn prev" aria-label="Previous slide">
          <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2"><path d="M15 18l-6-6 6-6" /></svg>
        </button>
        <span class="ppt-slide-counter">1 of 1</span>
        <button class="ppt-nav-btn next" aria-label="Next slide">
          <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2"><path d="M9 18l6-6-6-6" /></svg>
        </button>
      </div>
    </div>

    <script>
      class PowerPointViewer {
        constructor(container, config) {
          this.container = typeof container === "string" ? document.querySelector(container) : container;

          this.slides = config.slides || [];
          this.title = config.title || "Presentation";
          this.currentIndex = 0;

          this.viewport = this.container.querySelector(".ppt-slide-frame img");
          this.counter = this.container.querySelector(".ppt-slide-counter");
          this.prevBtn = this.container.querySelector(".ppt-nav-btn.prev");
          this.nextBtn = this.container.querySelector(".ppt-nav-btn.next");
          this.thumbnailsPanel = this.container.querySelector(".ppt-slides-panel");
          this.titleBar = this.container.querySelector(".ppt-titlebar-text");

          this.init();
        }

        init() {
          if (this.titleBar) {
            this.titleBar.textContent = `${this.title}.pptx - PowerPoint`;
          }
          this.createThumbnails();
          this.bindEvents();
          this.updateSlide();
        }

        createThumbnails() {
          if (!this.thumbnailsPanel) return;
          this.thumbnailsPanel.innerHTML = this.slides
            .map(
              (src, i) => `
            <div class="ppt-thumbnail ${i === 0 ? "active" : ""}" data-index="${i}">
              <span class="ppt-thumbnail-number">${i + 1}</span>
              <img src="${src}" alt="Slide ${i + 1}">
            </div>
          `
            )
            .join("");
        }

        bindEvents() {
          this.prevBtn?.addEventListener("click", () => this.prev());
          this.nextBtn?.addEventListener("click", () => this.next());

          this.thumbnailsPanel?.addEventListener("click", (e) => {
            const thumb = e.target.closest(".ppt-thumbnail");
            if (thumb) {
              this.goTo(parseInt(thumb.dataset.index));
            }
          });

          document.addEventListener("keydown", (e) => {
            if (e.key === "ArrowLeft") this.prev();
            if (e.key === "ArrowRight") this.next();
          });

          let startX = 0;
          this.container.addEventListener(
            "touchstart",
            (e) => {
              startX = e.touches[0].clientX;
            },
            { passive: true }
          );

          this.container.addEventListener(
            "touchend",
            (e) => {
              const diff = startX - e.changedTouches[0].clientX;
              if (Math.abs(diff) > 50) {
                diff > 0 ? this.next() : this.prev();
              }
            },
            { passive: true }
          );
        }

        updateSlide() {
          if (this.slides.length === 0) return;

          this.viewport.classList.add("loading");
          this.viewport.src = this.slides[this.currentIndex];
          this.viewport.onload = () => this.viewport.classList.remove("loading");

          this.counter.textContent = `${this.currentIndex + 1} of ${this.slides.length}`;

          this.prevBtn.disabled = this.currentIndex === 0;
          this.nextBtn.disabled = this.currentIndex === this.slides.length - 1;

          this.thumbnailsPanel?.querySelectorAll(".ppt-thumbnail").forEach((thumb, i) => {
            thumb.classList.toggle("active", i === this.currentIndex);
          });
        }

        prev() {
          if (this.currentIndex > 0) {
            this.currentIndex--;
            this.updateSlide();
          }
        }

        next() {
          if (this.currentIndex < this.slides.length - 1) {
            this.currentIndex++;
            this.updateSlide();
          }
        }

        goTo(index) {
          this.currentIndex = Math.max(0, Math.min(index, this.slides.length - 1));
          this.updateSlide();
        }
      }
